import React from 'react';
import { css, keyframes } from 'emotion'
import { MDBView, MDBMask } from "mdbreact";

import google from '../../images/google.jpg'

const Google = (props) => {
    return (
        <div className={styles.google}  onClick={() => props.showGoogle(true)}>
            <MDBView hover zoom>
                <img
                    className={styles.image}
                    src={google}
                    alt=""
                />
                <MDBMask className={styles.classname} overlay="cyan-light">
                    <div className={styles.test}><p>Bilingual Engineer</p>
                    <h5>My experience working to improve Google Search in Brazil.</h5></div>
                </MDBMask>
            </MDBView>
        </div>
    )
}

let classname = "flex-center";

const fadeInImage = keyframes` {
    0% {
        width: 30%;
        height: 30%;
    } 
    100% {
        width: 100%;
        width: 100%;
    }
}`

const styles = {
    google: css`
    height: 250px;
    width: 250px;
    cursor: pointer;
    `,
    image: css`
    animation: ${fadeInImage} 0.3s ease-out;
    `,
    classname: css`
    color: white;
    font-size: 1.5em;
    font-weight: bold;
    cursor: pointer;
    text-align: center;
    `,
    test: css`
    margin-top: 50%;
    width: auto;
    height: auto;
    background-color: black;
    `
}

export default Google;
